member.summary:
Get/set client-side function to execute when a menu item is selected. This can be any valid client script. This event is cancellable. To cancel event script function which is called should return false. If nothing is returned or true is returned postback is done.

If 

function OnItemClicked()
{
	// this references menu item HTML element
	// ... do something ...
	if ( bUserWantsToCancelPostback )
	{
		return false;
	}
	return true;
}

member.example:
To access a particular ToolBarItem, you can do as follows in Page_Init

        ToolBar[] tbs = this.RichTextEditor1.Toolbars;
        // Determine which toolbar in the above list you are interested in, by trial and error.
        ToolBar toolbar = tbs[1];
        // Then find the ToolBarItem you are looking for and disable the item, for example:
        toolbar.Items.Find("SpellCheck").Disabled = true;

