member.summary:
Get/set client-side function to execute when a ToolBarItem is selected. 
This can be any valid client script. This event can be cancelled. 
To cancel event script function which is called, it should return false.
If nothing is returned or true is returned postback is done.

If 

function OnItemClicked( EventItemData )
{
	// this references toolbar item HTML element
	// ... do something ...
	alert(EventItemData.Text);
	if ( bUserWantsToCancelPostback )
	{
		return false;
	}
	return true;
}

Get/set client-side function to execute when a TreeView item is selected. This can be any valid client script. This event is cancellable. To cancel event script function which is called should return false. If nothing is returned or true is returned postback is done.

If 

function OnItemClicked(NodeEventData)
{		
	// this references menu item HTML element
	// ... do something ...
	alert(NodeEventData.Text);
	if ( bUserWantsToCancelPostback )
	{
		return false;
	}
	return true;
}

member.example:
This example demostrates how to create custom logic for renaming and saving the existing uploaded files.        

protected void UploadBox1_FileExists(object sender, EventArgs e)
{
    string sFileName = UploadBox1.FileName;
    string sNameWithoutExtension = Path.GetFileNameWithoutExtension( sFileName );
    string sFileExtension = Path.GetExtension( sFileName );        
    for( int i = 1;; i++  )
    {
        string sNewFileName = string.Format( "{0}({1}){2}", sNameWithoutExtension, i, sFileExtension );
        string sNewFullpath = Path.Combine( UploadBox1.UploadFolder, sNewFileName );
        if( !File.Exists( sNewFullpath ) )
        {
            UploadBox1.File.MoveTo( sNewFullpath, false );
            break;
        }
    }
}

example.code:
This example demostrates how to save *.zip files in seperate folder.
protected bool UploadBox1_BeforeFileSave(object oSender, EventArgs e)
{
    bool bSaveInUploadFolder = true;
    if( Path.GetExtension( UploadBox1.File.FileName ) == ".zip" )
    {
        UploadBox1.File.MoveTo( "UserOverrideFolder/" + UploadBox1.File.FileName, true );

        //return false to cancel of file saving
        bSaveInUploadFolder = false;
    }
    return bSaveInUploadFolder;
}
